import React from "react";
import { Route, Switch } from "react-router-dom";

import home from "./larsen/Home3/index";
import grid from "./larsen/grid";
import past from "./larsen/past";
import about from "./larsen/about";
import Gallery from "./larsen/m";
import Quote from "./larsen/quote";
import more from "./pages/quote";

import Intake from "./larsen/Intake";

class Routes extends React.Component {
  render() {
    return (
      <Switch>

        <Route exact path ="/"component={home}/>
        <Route exact path ="/grid"component={grid}/>
        <Route exact path ="/Past events"component={past}/>
        <Route exact path ="/about"component={about}/>
        <Route exact path ="/gallery"component={Gallery}/>
        <Route exact path ="/quote"component={Quote}/>

        <Route exact path ="/more"component={more}/>
        <Route exact path ="/Intake"component={Intake}/>
        <Route
          render={function () {
            return <Route exact path ="/"component={home}/>;
          }}
        />
      </Switch>
    );
  }
}

export default Routes;
